// src/pages/UploadPage.jsx
import React, { useState } from 'react';
import axios from 'axios';

const UploadPage = () => {
  const [listing, setListing] = useState({
    title: '',
    description: '',
    location: '',
    price: '',
    image: ''
  });
  const [message, setMessage] = useState('');

  const handleChange = (e) => {
    setListing({...listing, [e.target.name]: e.target.value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const token = localStorage.getItem('token');
      await axios.post('http://localhost:5000/api/listings', listing, {
        headers: {
          Authorization: `Bearer ${token}`,
        },
      });
      setMessage('✅ Listing uploaded successfully!');
    } catch (error) {
      setMessage('❌ Failed to upload listing');
    }
  };

  return (
    <div className="p-6 max-w-xl mx-auto bg-white rounded-xl shadow-md">
      <h2 className="text-xl font-bold mb-4">Upload Property Listing</h2>
      <form onSubmit={handleSubmit} className="space-y-4">
        <input type="text" name="title" placeholder="Title" className="w-full p-2 border rounded" onChange={handleChange} required />
        <textarea name="description" placeholder="Description" className="w-full p-2 border rounded" onChange={handleChange} required />
        <input type="text" name="location" placeholder="Location" className="w-full p-2 border rounded" onChange={handleChange} required />
        <input type="number" name="price" placeholder="Price" className="w-full p-2 border rounded" onChange={handleChange} required />
        <input type="text" name="image" placeholder="Image URL" className="w-full p-2 border rounded" onChange={handleChange} />
        <button type="submit" className="w-full bg-green-500 text-white py-2 rounded">Upload</button>
      </form>
      {message && <p className="mt-4 text-sm">{message}</p>}
    </div>
  );
};

export default UploadPage;
